<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>C++ est un langage puissant. Couplé à <b>Qt</b>, vous avez entre les mains un Framework multiplateforme qui allie performance et simplicité d'utilisation. Qt est un vaste Framework qui fournit des outils dans de nombreux domaines (interface graphique, threads, réseau, etc.). Plusieurs années après sa création, Qt continue d'évoluer et de croître à chaque version. Avec les nouveaux ajouts C++14 (lambdas, pointeurs intelligents, classes enum, etc.), Qt nous offre une boîte à outils de développement sûre et puissante. Nous avons la possibilité de mettre en place l'architecture MVC (Modèle-Vue-Contrôleur) qui nous permet de réaliser des applications complexes. Avec QML et Qt Quick nous pouvons créer des applications mobiles.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
