</div>
</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="creation-d-un-projet-qt_creation-d-un-projet" href="#creation-d-un-projet-qt">Création d'un projet</a>
</h2><br>La première chose à faire est de démarrer Qt Creator.<br>Dans Qt Creator, vous pouvez créer un nouveau projet Qt via:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="creation-d-un-projet-qt_fichier-projet" href="#creation-d-un-projet-qt">Fichier projet</a>
</h2><br>Le fichier .pro est le fichier de projet de configuration de Qt. À mesure que Qt ajoute des formats de fichiers spécifiques et des mots-clés C++, une étape de construction intermédiaire est effectuée, analysant tous les fichiers pour générer les fichiers finaux.
Ce processus est effectué par qmake, un exécutable du SDK Qt. Il générera également les Makefiles finaux pour votre projet.<br><br>Certaines fonctionnalités intéressantes sont fournies avec Qt et C++17. Pour les compilateurs GCC et CLANG, vous devez ajouter CONFIG += c++17 au fichier .pro pour activer C++17 sur un projet Qt, comme indiqué dans le code suivant:<br><br><pre class="GCode1 Code1 AceCode" data-mode="prolog" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">QT       += core gui

greaterThan(QT_MAJOR_VERSION, 4): QT += widgets

CONFIG += c++17

# You can make your code fail to compile if it uses deprecated APIs.
# In order to do so, uncomment the following line.
#DEFINES += QT_DISABLE_DEPRECATED_BEFORE=0x060000    # disables all the APIs deprecated before Qt 6.0.0

SOURCES += \
    main.cpp \
    MainWindow.cpp

HEADERS += \
    MainWindow.h

FORMS += \
    MainWindow.ui

# Default rules for deployment.
qnx: target.path = /tmp/$${TARGET}/bin
else: unix:!android: target.path = /opt/$${TARGET}/bin
!isEmpty(target.path): INSTALLS += target</pre><br></div>
